import React, { Component } from "react"
import artwork from "./artwork.js"
export default class PaintingList extends Component {
  render(){
    const allPaintings = artwork.map(painting => <li>{painting.title}</li>)
    console.log(allPaintings)
    return(
      <ul>
        {allPaintings}
      </ul>
    )
  }
}
